#include <fstream>

int main() {
    std::ifstream in("exponent.in");
    std::ofstream out("exponent.out");

    int n, k;
    in >> n >> k;
    int exp = 0;
    for (int i = 1; i <= n; ++i) {
        int x = i;
        while (x % k == 0) {
            ++exp;
            x /= k;
        }
    }
    out << exp << '\n';
    return 0;
}
